  `store_number` int(11) NOT NULL COMMENT '门店唯一编号',
  `store_name` varchar(32) NOT NULL COMMENT '门店名称',
  `store_type` tinyint(3) NOT NULL COMMENT '门店类型（1：直营，2：加盟）',
  `top_category` varchar(10) NOT NULL COMMENT '所属门店顶级id',
  `shop_category` varchar(10) NOT NULL COMMENT '所属门店id',
  `phone` varchar(20) NOT NULL COMMENT '联系电话',
