  `distance` double DEFAULT NULL,
  `shop_id` varchar(32) DEFAULT NULL COMMENT '蚂蚁店铺id',
  `enabled_sell_clear` tinyint(3) NOT NULL DEFAULT '0' COMMENT '启用沽清',
  `sell_clear` varchar(10) DEFAULT NULL COMMENT '自定义沽清时间',
